    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) cor0 WHERE col1 IN ( - ( col1 ), + 65 * + + col1, 0 * + + 18 + + - col1 / 44, col1, - 60 * - + col0 + - 0, - col2, - + col0 * + - col1 * + + 98 + + - col2 * - col0 );
  - name: tab1

outputs:
  - name: q2149.out
    data: |
      51	14	96
      85	5	59
      91	47	68
